DROP DATABASE IF EXISTS similar;

CREATE DATABASE similar;

USE similar;

CREATE TABLE listings (
  id int NOT NULL AUTO_INCREMENT,
  title varChar(100),
  picture varChar(100),
  houseType varchar(30),
  beds int,
  cost int,
  stars int,
  rating int,
  liked boolean,
  PRIMARY KEY (ID)
);

CREATE TABLE lists (
  id int NOT NULL AUTO_INCREMENT,
  name varchar(40),
  PRIMARY KEY (ID)
);

CREATE TABLE lists2listings (
  listingId int NOT NULL,
  listId int NOT NULL,
  PRIMARY KEY (listingId, listId)
);

